    const handleLogout = () => {
        onLogin(false)
    }

    let userName = getUser
    if (userName !== null) {
        return(
            <div className="navbar">
                <div className="leftSide">
                    <Icon/>
                </div>
                <div className="rightSide">
                    <Link to="/home"> Home </Link>
                    <Link to="/dashboard"> Dashboard </Link>
                    <Link to="/landing" onClick={handleLogout}>Logout</Link>
