                        toggleNavbar
                    </button>
                </div>
            </div>
        );
    } else {
        return(
            <div className="navbar">
                <div className="leftSide">
                    <Icon/>
                </div>
                <div className="rightSide">
                    <Link to="/register"> Registrar </Link>
                    <Link to="/login"> Login </Link>
                    <button onClick={toggleNavbar}>
                        toggleNavbar
                    </button>
                </div>
            </div>
        );
    }
}
